import React, { useState } from 'react'
import Plugin from 'chartist-plugin-fill-donut'
import ChartistGraph from 'react-chartist'

const CardGraph = () => {
    const [Data] = useState(
        {
            ChartData:{
                series: [1,3,2]
            },
            ChartOptions:{
                donut: true,
                donutWidth:10,
                showLabel:true,

            }
        }
    )
    return (
        <ChartistGraph 
        type={'Pie'}
        data={Data.ChartData}
        options={Data.ChartOptions}
        />
    )
}

export default CardGraph
